import React from 'react';
import styles from './searchForm.module.css'

function SearchForm() {
    return (
        <div className={styles.searchForm}>
            <form>
                <input type='text' />
                <button>RESET</button>
                <button>SEARCH</button>
            </form>
        </div>
    )
}

export default SearchForm
